  summary: >-
    Converts the geographic coordinates to an array of doubles, where the first element is the longitude

    and the second element is the latitude, both in degrees.
  remarks: >-
    This method provides a simple conversion of the <xref href="Pelias.NET.Model.Objects.Pelias.GeographicInformationSystems.Coordinates.Longitude" data-throw-if-not-resolved="false"></xref> and <xref href="Pelias.NET.Model.Objects.Pelias.GeographicInformationSystems.Coordinates.Latitude" data-throw-if-not-resolved="false"></xref>

    properties to an array of double values. The longitude is the first element, followed by latitude.
